			[
                'product_id' => 1,
                'language_code' => 'tr',
                'name' => 'Lenovo Flex 5',
                'summary' => 'IdeaPad Flex 5 (14, Intel) 2\'si 1 arada dizst bilgisayarla dilediiniz gibi balann, etkileim kurun, aln ve oyun oynayn.',
                'description' => '<p>The 30-inch Apple Cinema HD Display delivers an amazing 2560 x 1600 pixel resolution. Designed specifically for the creative professional, this display provides more space for easier access to all the tools and palettes needed to edit, format and composite your work. Combine this display with a Mac Pro, MacBook Pro, or PowerMac G5 and theres no limit to what you can achieve.<br><br></p><p>The Cinema HD features an active-matrix liquid crystal display that produces flicker-free images that deliver twice the brightness, twice the sharpness and twice the contrast ratio of a typical CRT display. Unlike other flat panels, its designed with a pure digital interface to deliver distortion-free images that never need adjusting. With over 4 million digital pixels, the display is uniquely suited for scientific and technical applications such as visualizing molecular structures or analyzing geological data.<br><br></p><p>Offering accurate, brilliant color performance, the Cinema HD delivers up to 16.7 million colors across a wide gamut allowing you to see subtle nuances between colors from soft pastels to rich jewel tones. A wide viewing angle ensures uniform color from edge to edge. Apples ColorSync technology allows you to create custom profiles to maintain consistent color onscreen and in print. The result: You can confidently use this display in all your color-critical applications.<br><br></p><p>Housed in a new aluminum design, the display has a very thin bezel that enhances visual accuracy. Each display features two FireWire 400 ports and two USB 2.0 ports, making attachment of desktop peripherals, such as iSight, iPod, digital and still cameras, hard drives, printers and scanners, even more accessible and convenient. Taking advantage of the much thinner and lighter footprint of an LCD, the new displays support the VESA (Video Electronics Standards Association) mounting interface standard. Customers with the optional Cinema Display VESA Mount Adapter kit gain the flexibility to mount their display in locations most appropriate for their work environment.<br><br></p><p>The Cinema HD features a single cable design with elegant breakout for the USB 2.0, FireWire 400 and a pure digital connection using the industry standard Digital Video Interface (DVI) interface. The DVI connection allows for a direct pure-digital connection.<br></p><h3>Features:</h3><p>Unrivaled display performance</p><ul><li>30-inch (viewable) active-matrix liquid crystal display provides breathtaking image quality and vivid, richly saturated color.</li><li>Support for 2560-by-1600 pixel resolution for display of high definition still and video imagery.</li><li>Wide-format design for simultaneous display of two full pages of text and graphics.</li><li>Industry standard DVI connector for direct attachment to Mac- and Windows-based desktops and notebooks</li><li>Incredibly wide (170 degree) horizontal and vertical viewing angle for maximum visibility and color performance.</li><li>Lightning-fast pixel response for full-motion digital video playback.</li><li>Support for 16.7 million saturated colors, for use in all graphics-intensive applications.</li></ul><p>Simple setup and operation</p><ul><li>Single cable with elegant breakout for connection to DVI, USB and FireWire ports</li><li>Built-in two-port USB 2.0 hub for easy connection of desktop peripheral devices.</li><li>Two FireWire 400 ports to support iSight and other desktop peripherals</li></ul><p>Sleek, elegant design</p><ul><li>Huge virtual workspace, very small footprint.</li><li>Narrow Bezel design to minimize visual impact of using dual displays</li><li>Unique hinge design for effortless adjustment</li><li>Support for VESA mounting solutions (Apple Cinema Display VESA Mount Adapter sold separately)</li></ul><h3>Technical specifications</h3><p><b>Screen size (diagonal viewable image size)</b></p><ul><li>Apple Cinema HD Display: 30 inches (29.7-inch viewable)</li></ul><p><b>Screen type</b></p><ul><li>Thin film transistor (TFT) active-matrix liquid crystal display (AMLCD)</li></ul><p><b>Resolutions</b></p><ul><li>2560 x 1600 pixels (optimum resolution)</li><li>2048 x 1280</li><li>1920 x 1200</li><li>1280 x 800</li><li>1024 x 640</li></ul><p><b>Display colors (maximum)</b></p><ul><li>16.7 million</li></ul><p><b>Viewing angle (typical)</b></p><ul><li>170 horizontal; 170 vertical</li></ul><p><b>Brightness (typical)</b></p><ul><li>30-inch Cinema HD Display: 400 cd/m2</li></ul><p><b>Contrast ratio (typical)</b></p><ul><li>700:1</li></ul><p><b>Response time (typical)</b></p><ul><li>16 ms</li></ul><p><b>Pixel pitch</b></p><ul><li>30-inch Cinema HD Display: 0.250 mm</li></ul><p><b>Screen treatment</b></p><ul><li>Antiglare hardcoat</li></ul><p><b>User controls (hardware and software)</b></p><ul><li>Display Power,</li><li>System sleep, wake</li><li>Brightness</li><li>Monitor tilt</li></ul><p><b>Connectors and cables</b><br>Cable</p><ul><li>DVI (Digital Visual Interface)</li><li>FireWire 400</li><li>USB 2.0</li><li>DC power (24 V)</li></ul><p>Connectors</p><ul><li>Two-port, self-powered USB 2.0 hub</li><li>Two FireWire 400 ports</li><li>Kensington security port</li></ul><p><b>VESA mount adapter</b><br>Requires optional Cinema Display VESA Mount Adapter (M9649G/A)</p><ul><li>Compatible with VESA FDMI (MIS-D, 100, C) compliant mounting solutions</li></ul><p><b>Electrical requirements</b></p><ul><li>Input voltage: 100-240 VAC 50-60Hz</li><li>Maximum power when operating: 150W</li><li>Energy saver mode: 3W or less</li></ul><p><b>Environmental requirements</b></p><ul><li>Operating temperature: 50 to 95 F (10 to 35 C)</li><li>Storage temperature: -40 to 116 F (-40 to 47 C)</li><li>Operating humidity: 20% to 80% noncondensing</li><li>Maximum operating altitude: 10,000 feet</li></ul><p><b>Agency approvals</b></p><ul><li>FCC Part 15 Class B</li><li>EN55022 Class B</li><li>EN55024</li><li>VCCI Class B</li><li>AS/NZS 3548 Class B</li><li>CNS 13438 Class B</li><li>ICES-003 Class B</li><li>ISO 13406 part 2</li><li>MPR II</li><li>IEC 60950</li><li>UL 60950</li><li>CSA 60950</li><li>EN60950</li><li>ENERGY STAR</li><li>TCO 03</li></ul><p><b>Size and weight</b><br>30-inch Apple Cinema HD Display</p><ul><li>Height: 21.3 inches (54.3 cm)</li><li>Width: 27.2 inches (68.8 cm)</li><li>Depth: 8.46 inches (21.5 cm)</li><li>Weight: 27.5 pounds (12.5 kg)</li></ul><p><b>System Requirements</b></p><ul><li>Mac Pro, all graphic options</li><li>MacBook Pro</li><li>Power Mac G5 (PCI-X) with ATI Radeon 9650 or better or NVIDIA GeForce 6800 GT DDL or better</li><li>Power Mac G5 (PCI Express), all graphics options</li><li>PowerBook G4 with dual-link DVI support</li><li>Windows PC and graphics card that supports DVI ports with dual-link digital bandwidth and VESA DDC standard for plug-and-play setup</li></ul>',
